  //   console.log(formData);
  //   // Redirect to login page after signup
  //   navigate('/login');
  // };

  return (
  <Box>
      <Header/>
      <Container maxWidth="sm">
        <Box
          sx={{
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            mt: 8,
          }}
        >
          <Typography component="h1" variant="h5" sx={{color:'#DAA520'}}>
            Sign Up
          </Typography>
          <Box component="form" onSubmit={handleSubmit} 
                sx={{ mt: 3, '& .MuiOutlinedInput-root': {
                  '& fieldset': {
                    borderColor: 'white', 
                  },
                  '&:hover fieldset': {
                    borderColor: '#DAA520', 
                  },
                  '&.Mui-focused fieldset': {
                    borderColor: '#DAA520', 
                  },
                },
                '& .MuiInputLabel-root': {
                  color: 'white',
                },
                '& .MuiInputLabel-root.Mui-focused': {
                  color: '#DAA520',
                },}}>
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              id="firstName"
              label="First Name"
              name="firstName"
              autoComplete="fname"
              autoFocus
              // value={formData.firstName}
              // onChange={handleChange}
              sx={{

              }}
            />
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              id="lastName"
              label="Last Name"
              name="lastName"
              autoComplete="lname"
              // value={formData.lastName}
              // onChange={handleChange}
            />
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              value={formData.email}
              onChange={handleChange}
            />
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
              // value={formData.password}
              // onChange={handleChange}
            />
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{
                mt: 3,
                mb: 2,
                backgroundColor: '#DAA520',
                color: 'black',
                '&:hover': {
                  backgroundColor: '#B8860B',
                },
              }}
            >
              Sign Up
            </Button>
            <Link href="/login" variant="body2" sx={{ color: '#DAA520', textTransform: 'none' }}>
              {"Already have an account? Sign in"}
            </Link>
          </Box>
        </Box>
      </Container>
      <Footer/>
    </Box>
  );
};

export default Signup;
